import './css/Products.css'

var products = [
    {
        name: "Chleb",
        price: 3.50
    },
    {
        name: "Mydło",
        price: 5.00
    }
];

function mapToLi() {
    return products.map(product => {
        return (
            <li>
                <span>{product.name}</span>
                <span>{product.price}</span>  
                <button>Add to cart</button>
            </li>
        );
    });
}

function Products() {
    return (
        <div>
            <h1>Products</h1>
            <ul>{mapToLi()}</ul>
        </div>
    );
}

export default Products;
